// const isJsError = event instanceof ErrorEvent;\r\n    // if (!isJsError) return mechanismType.RS;\r\n\r\n    // 有 e.target.src(href) 的认定为资源加载错误\r\n    const target = event.target;\r\n    // const isElementTarget: boolean = target && (target.src || target.href);\r\n    const isElementTarget: boolean = target instanceof HTMLScriptElement || target instanceof HTMLLinkElement || target instanceof HTMLImageElement;\r\n    if (isElementTarget) {\r\n        return mechanismType.RS;\r\n    }\r\n    if (event instanceof AxiosError) {\r\n        return mechanismType.CS;\r\n    }\r\n    // return event.message === 'Script error.' ? mechanismType.CS : mechanismType.JS;\r\n    return mechanismType.JS;\r\n};\r\n\r\n// 获取用户最后一个交互事件\r\nexport function getLastEvent() {\r\n    let lastEvent: Event;\r\n    [\r\n        'click',\r\n        'mousedown',\r\n        // 'mouseover',\r\n        'keydown',\r\n        'touchstart',\r\n    ].forEach(eventType => {\r\n        window.addEventListener(\r\n          eventType,\r\n          (event) => {\r\n            lastEvent = event;\r\n          },\r\n          {\r\n              capture: true,\r\n              passive: true // 默认不阻止默认事件\r\n          }\r\n      );\r\n    })\r\n    return lastEvent;\r\n}\r\n\r\n// 获取选择器\r\nexport function getSelector(pathsOrTarget: any) {\r\n  console.log('params', pathsOrTarget)\r\n\r\n  const handleSelector = function (pathArr: any) {\r\n    return pathArr\r\n      .reverse()\r\n      .filter((element: any) => {\r\n        // 去除 document 和 window\r\n        return element !== document && element !== window;\r\n      })\r\n      .map((element: any) => {\r\n        const { id, className, tagName } = element;\r\n        if (id) {\r\n          return `${tagName.toLowerCase()}#${id}`;\r\n        } else if (className && typeof className === 'string') {\r\n          return `${tagName.toLowerCase()}.${className}`;\r\n        } else {\r\n          return tagName.toLowerCase();\r\n        }\r\n      })\r\n      .join(' ');\r\n  }\r\n\r\n    if (Array.isArray(pathsOrTarget)) {\r\n        return handleSelector(pathsOrTarget);\r\n    } else {\r\n        let pathArr = [];\r\n        while (pathsOrTarget) {\r\n            pathArr.push(pathsOrTarget);\r\n            pathsOrTarget = pathsOrTarget.parentNode;\r\n        }\r\n        return handleSelector(pathArr);\r\n    }\r\n}\r\n\r\n// 获取当前时间戳：hh:mm:ss 格式 或者 毫秒格式\r\n// 参数为 data.hms === true 是 hh:mm:ss 格式，否则为毫秒格式\r\n// 可以参数 data.time 创建 Date 对象\r\nexport function nowTime(data: { hms?: boolean, time?: number }): number | string {\r\n    const { hms, time } = data;\r\n    if (hms === true) {\r\n        const newTime = time ? new Date(time) : new Date();\r\n        const hour = newTime.getHours();\r\n        const minute = newTime.getMinutes();\r\n        const second = newTime.getSeconds();\r\n        const timer = hour + ':' + minute + ':' + second + ' ';\r\n        return timer;\r\n    }\r\n    return new Date().getTime();\r\n}\r\n\r\n// 判断白屏的时机\r\nexport function isLoad(callback) {\r\n    if (document.readyState === 'complete') {\r\n        callback();\r\n    } else {\r\n        window.addEventListener('load', callback);\r\n    }\r\n}\r\n\r\n// 计算用时\r\nexport function calcDuration(metrics: httpMetrics) {\r\n    metrics.duration = metrics.responseTime - metrics.requestTime;\r\n}\r\n\r\n\r\n\r\n\r\n// 根据行数获取源文件行数 todo\r\n// export async function getPosition (map, lineno, colno) {\r\n//     const consumer = await new sourceMap.SourceMapConsumer(map);\r\n//\r\n//     const position = consumer.originalPositionFor({\r\n//         line: lineno,\r\n//         column: colno\r\n//     })\r\n//\r\n//     // position.content = consumer.sourceContentFor(position.source)\r\n//\r\n//     return position;\r\n// }\r\n\r\n// 创建 js error 对象\r\nexport function createJsError(\r\n  message: any,\r\n  type: any,\r\n  filename: any,\r\n  lineno: any,\r\n  colno: any,\r\n  selector: any\r\n) {\r\n  // todo sourceMap\r\n  // const obj = getPosition('monitor.cjs.js.map', lineno, colno);\r\n  // console.log('obj', obj);\r\n\r\n  return new JsError(\r\n    message,\r\n    type,\r\n    mechanismType.JS,\r\n    filename,\r\n    `${lineno}:${colno}`,\r\n    selector\r\n  );\r\n}\r\n\r\n// 创建 resource error 对象\r\nexport function createResourceError(event: any, src: string, outerHTML: any, tagName: any) {\r\n  return new ResourceError(\r\n    event.type,\r\n    src,\r\n    `GET ${src} net::ERR_CONNECTION_REFUSED`,\r\n    outerHTML,\r\n    mechanismType.RS,\r\n    tagName,\r\n    getSelector(event.path)\r\n  );\r\n}\r\n\r\n// 创建 cors error 对象\r\nexport function createCorsError(\r\n  name: string,\r\n  message: string,\r\n  url: string,\r\n  method: string,\r\n  response: any,\r\n  request: any,\r\n  params: any,\r\n  data: any\r\n) {\r\n  return new CorsError(\r\n    mechanismType.CS,\r\n    name,\r\n    message,\r\n    url,\r\n    method,\r\n    response.status,\r\n    response ? JSON.stringify(response) : '',\r\n    request ? JSON.stringify(request) : '',\r\n    { query: params, body: data }\r\n  )\r\n}\r\n\r\n// 创建 promise error 对象\r\nexport function createPromiseError(\r\n  message: string,\r\n  event: any,\r\n  filename: string,\r\n  line: number,\r\n  column: number,\r\n  selector: any\r\n) {\r\n  return new PromiseError(\r\n    message,\r\n    event.type,\r\n    mechanismType.UJ,\r\n    filename,\r\n    `${line}:${column}`,\r\n    selector\r\n  )\r\n}\r\n","import { addCache, getCache, clearCache } from \"../handle/cache\";\r\n\r\nlet timer = null;\r\n\r\nexport function lazyReport(interfaceUrl: string, param): void {\r\n    const cookie: string = window['_monitor_user_cookie_'];\r\n    const delay: number = window['_monitor_delay_'];\r\n    console.log('!!!', interfaceUrl, param)\r\n\r\n    const logParams = {\r\n        cookie, // 用户id\r\n        interfaceUrl, // error/action/visit/user\r\n        data: param, // 上报的数据\r\n        currentTime: new Date().getTime(),\r\n        currentPage: window.location.href,\r\n        ua: window.navigator.userAgent,\r\n    }\r\n\r\n    // let logParamsString = JSON.stringify(logParams);\r\n    //     addCache(logParamsString);\r\n\r\n    // const data = getCache();\r\n    // let data = JSON.stringify(param);\r\n\r\n    // if (delay === 0) {\r\n        return index(interfaceUrl, logParams);\r\n    // }\r\n\r\n      // if (data.length > 10) {\r\n      //   index(interfaceUrl, data);\r\n      //   clearTimeout(timer);\r\n      //   return;\r\n      // }\r\n\r\n    // clearTimeout(timer);\r\n    //\r\n    // timer = setTimeout(() => {\r\n    //     index(interfaceUrl, logParams);\r\n    // }, delay);\r\n}\r\n\r\nexport function index(interfaceUrl: string, data: object): void {\r\n  const url = window['_monitor_report_url_'];\r\n\r\n  // ------- fetch方式上报 -------\r\n  // 跨域问题\r\n  // fetch(url, {\r\n  //   method: 'POST',\r\n  //   body: JSON.stringify(data),\r\n  //   headers: {\r\n  //     'Content-Type': 'application/json',\r\n  //   },\r\n  // }).then(res => {\r\n  //   console.log(res);\r\n  // }).catch(err => {\r\n  //   console.error(err);\r\n  // })\r\n\r\n  // ------- navigator/img方式上报 -------\r\n  // 不会有跨域问题\r\n  if (navigator.sendBeacon) { // 支持sendBeacon的浏览器\r\n    navigator.sendBeacon(url + interfaceUrl, JSON.stringify(data));\r\n  } else { // 不支持sendBeacon的浏览器\r\n      let oImage = new Image();\r\n    oImage.src = `${url}${interfaceUrl}?logs=${data}`;\r\n  }\r\n  // clearCache();\r\n}\r\n","export class ConsoleError {\r\n  public message: string;\r\n  public column: number;\r\n  public row: number;\r\n  public stack: string;\r\n  public url: string;\r\n\r\n  constructor(message, column, row, stack, url) {\r\n    this.message = message;\r\n    this.column = column;\r\n    this.row = row;\r\n    this.stack = stack;\r\n    this.url = url;\r\n  }\r\n}\r\n","// import { proxyFetch } from \"@/monitor/injectFetch\";\r\n// import { proxyXmlHttp } from \"@/monitor/injectXHR\";\r\nimport { AxiosError } from \"axios\";\r\nimport {\r\n  calcDuration,\r\n  createCorsError,\r\n  createJsError,\r\n  createPromiseError,\r\n  createResourceError,\r\n  getErrorKey,\r\n  getLastEvent,\r\n  getSelector,\r\n  isLoad\r\n} from \"@util/index\";\r\nimport { BlackScreenDataType as initData, httpMetrics, mechanismType } from \"../../type/index\";\r\nimport { lazyReport } from \"@monitor/report/index\";\r\nimport { ConsoleError } from \"@monitor/class/ConsoleError\";\r\n\r\n// --------  Error error / resource error / script error ---------\r\nexport const handleJs = function (event: any): void {\r\n  event.preventDefault();\r\n\r\n  // 用户最后一个交互事件\r\n  const lastEvent: Event = getLastEvent();\r\n\r\n  // 判断是否跨域\r\n  const type = getErrorKey(event);\r\n\r\n  if (type === mechanismType.RS) {\r\n    const { src, outerHTML, tagName } = event.target;\r\n\r\n    const resourceError = createResourceError(event, src, outerHTML, tagName);\r\n    console.log('resourceError log数据', resourceError);\r\n    lazyReport('/resource', resourceError);\r\n  } else if (type === mechanismType.JS) {\r\n\r\n    const { message, type, filename, lineno, colno } = event;\r\n    const selector = lastEvent ? getSelector((lastEvent as any).path!) : '';\r\n\r\n    const jsError = createJsError(message, type, filename, lineno, colno, selector);\r\n    console.log('jsError log数据dddddd', jsError);\r\n    lazyReport('/js', jsError);\r\n  } else if (type === mechanismType.CS) {\r\n    let { url, method, params, data } = event.config;\r\n    const { name, message, response, request } = event;\r\n\r\n    const corsErrorData = createCorsError(name, message, url, method, response, request, params, data)\r\n    console.log('CORSError log数据', corsErrorData)\r\n  }\r\n}\r\n// ------  promise error  --------\r\nexport const handlePromise = function (event: any): void {\r\n  // const isCors = event.reason instanceof AxiosError;\r\n  const isCors = event?.reason?.name === 'AxiosError';\r\n  if (!isCors) {\r\n    // 用户最后一个交互事件\r\n    const lastEvent: Event = getLastEvent();\r\n    // let stack: string = '';\r\n    let message: string = '';\r\n    let filename: string = '';\r\n    let line: number = 0;\r\n    let column: number = 0;\r\n    let reason = event.reason;\r\n\r\n    if (typeof reason === 'string') {\r\n      message = reason;\r\n    } else if (typeof reason === 'object') {\r\n      if (reason.stack) {\r\n        let matchResult = reason.stack.match(/at\\s+(.+):(\\d+):(\\d+)/);\r\n        filename = matchResult[1];\r\n        line = matchResult[2];\r\n        column = matchResult[3];\r\n      }\r\n      message = reason.message;\r\n    }\r\n    const selector = lastEvent ? getSelector((lastEvent as any).path) : '';\r\n    const promiseErrorData = createPromiseError(message, event, filename, line, column, selector);\r\n    console.log('promise log数据', promiseErrorData);\r\n    lazyReport('/promise', promiseErrorData);\r\n  } else {\r\n    const { config, name, message, response, request } = event.reason;\r\n    let { url, method, params, data } = config;\r\n    const corsErrorData = createCorsError(name, message, url, method, response, request, params, data);\r\n    console.log('CORSError log数据', corsErrorData);\r\n    lazyReport('/cors', corsErrorData);\r\n  }\r\n}\r\n// ------  console.error  --------\r\nexport const injectConsole = () => {\r\n  // ------  console.error  --------\r\n  let consoleError = window.console.error;\r\n  window.console.error = function (error) {\r\n    if (error != '参数有缺失') {\r\n      const { message, stack } = error;\r\n      let column: number = 0;\r\n      let row: number = 0;\r\n      let url = window.location.href;\r\n\r\n      const consoleErrorData = createConsoleError(message, column, row, stack, url);\r\n\r\n      if (stack) {\r\n        let mres = stack.match(/\\(.*?\\)/g) || [];\r\n        let firstLine = (mres[0] || '').replace('(', '').replace(')', '') // 获取到堆栈信息的第一条\r\n\r\n        // 根据:分隔获取行列\r\n        let info = firstLine.split(':');\r\n        row = +info[info.length - 2]; // 行\r\n        column = +info[info.length - 1]; // 列\r\n      }\r\n\r\n      // setTimeout(function () {\r\n      // 上报错误内容\r\n      consoleErrorData.row = row;\r\n      consoleErrorData.column = column;\r\n      // let opt = {\r\n      //   url,\r\n      //   row,\r\n      //   column,\r\n      //   message,\r\n      //   stack, // 错误堆栈信息\r\n      // }\r\n      console.log('error捕获', consoleErrorData);\r\n      lazyReport('/console-error', consoleErrorData);\r\n      // }, 0);\r\n    }\r\n\r\n    return consoleError.apply(console, arguments as any);\r\n\r\n    function createConsoleError(\r\n      message: any,\r\n      column: number,\r\n      row: number,\r\n      stack: any,\r\n      url: string\r\n    ) {\r\n      return new ConsoleError(message, column, row, stack, url);\r\n    }\r\n  }\r\n}\r\n\r\n// 调用 proxyFetch 即可完成全局监听 fetch\r\nconst proxyFetch = (sendHandler: Function | null | undefined, loadHandler: Function) => {\r\n  if (isExistsFetch()) {\r\n    const _Fetch = getNewFetch()\r\n\r\n    ;(window as any).fetch = async (input: any, init: RequestInit) => {\r\n      // init 是用户手动传入的 fetch 请求互数据，包括了 method、body、headers，要做统一拦截数据修改，直接改init即可\r\n\r\n      if (typeof sendHandler === 'function') {\r\n        sendHandler(init)\r\n      }\r\n      let metrics = {} as httpMetrics\r\n\r\n      initMetrics()\r\n\r\n      return _Fetch\r\n        .call(window, input, init)\r\n        .then(async response => {\r\n          // clone 出一个新的 response,再用其做.text(),避免 body stream already read 问题\r\n          const { status, statusText, url } = response\r\n          let message: string\r\n\r\n          setMessageByStatus()\r\n\r\n          const res = response.clone()\r\n          await setMetrics()\r\n\r\n          if (typeof loadHandler === 'function') {\r\n            loadHandler(metrics)\r\n          }\r\n\r\n          console.log('fetch then', metrics)\r\n\r\n          return metrics\r\n\r\n          function setMessageByStatus() {\r\n            if (status >= 200 && status <